class CMS extends React.Component {

   constructor(props) {
      super(props);

      this.state = {
         dataList: []
      }
   }

   componentDidMount(){
      const url = 'http://localhost:5000/api/letters/';

      fetch(url)
         .then(response => response.json())
         .then(json => console.log(json))
   }

   render() {
      return (
         <div>
            <h2>CMS</h2>
            {/* {this.state.dataList} */}
         </div>
      )
   }
}

export default CMS;
